import React from "react";
import Slidecss from "./Slide.module.css";

const Slide = () => {
  return (
    <div className={Slidecss.container}>
      <div className={Slidecss.element1}></div>
      <div className={Slidecss.element2}></div>
      <div className={Slidecss.element3}></div>
      <div className={Slidecss.element4}></div>
    </div>
  );
};

export default Slide;
